import React from 'react'

const View = ({jobs}) => {

    return jobs.map(job=>(
        <tr key= {job.id} >
        <td>{job.task}</td>
        <td className='delete-btn' onClick= {()=>deletejob(job.id)}> </td>
        </tr>  
    ))
}


export default View
